import Editor from "./components/editor";
import React from "react";
import {
  BrowserRouter as Router,
  Switch,
  Route
} from "react-router-dom";
function App() {
  return (
    <div className="App">
      <Router>
        <Switch>
          <Route path="/" exact>Home</Route>
          <Route path="/document/:id"><Editor/></Route>
        </Switch>

      </Router>

    </div>
  );
}

export default App;
